    // Quad / billboard (2 x 2)
    //
    //  v1------v0
    //  |       |
    //  |   x   |
    //  |       |
    //  v2------v3
    
    gl.bindBuffer(34962, W.vertices.q = W.vertices.b = gl.createBuffer());
    
    //gl.bufferData(gl.ARRAY_BUFFER, new Float32Array(vertices), gl.STATIC_DRAW);
    gl.bufferData(34962, new Float32Array([
      1, 1, 0,    -1, 1, 0,   -1,-1, 0,
      1, 1, 0,    -1,-1, 0,    1,-1, 0
    ]), 35044); 

